import React, { Component, Fragment } from 'react'
import { MapContainer, TileLayer, Marker, Popup, Circle, LayersControl, LayerGroup, FeatureGroup, Rectangle } from 'react-leaflet';
import L from 'leaflet';
import iconShadow from 'leaflet/dist/images/marker-shadow.png';
import icon from 'leaflet/dist/images/marker-icon.png';
import Maker from './Carga'


import axios from 'axios'
import { Link } from "react-router-dom";






let Icon = L.icon({
    iconUrl: icon,
    shadowUrl: iconShadow
});


export default class Servicios extends Component {

    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/arriendos')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }
    render() {

        const pos = [-41.471667, -72.936667 ]
        const zoom = 15

        return (
            <div>
                <MapContainer
                    className="map"
                    center={pos}
                    zoom={zoom}
                    style={{ height: 300 }}
                    scrollWheelZoom={false}
                >
                    <LayersControl position="topright">

                        <TileLayer
                            attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
                            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                        />

                        <LayersControl.Overlay name="Holaa 1">
                            <LayerGroup>
                                {this.state.prop.map((item) => {
                                        <Marker position={item.coordenadasP} icon={Icon} />
                                })}
                                </LayerGroup>
                        </LayersControl.Overlay>

                        <LayersControl.Overlay name="Hola 2">
                        <Marker position={pos} icon={Icon} >
                            <Popup>
                                hola
                            </Popup>
                            </Marker>
                        </LayersControl.Overlay>
                    </LayersControl>
                </MapContainer>
            </div>
        );
    }
}
